import React from "react";
import "../Styles/Items.scss";

function Items({ itemsList, setItemsList }) {
  return (
    <div className="items-container">
      {itemsList.map((item) => (
        <h4>{item}</h4>
      ))}
    </div>
  );
}

export { Items };
